import React , { Component } from 'react'

class DataSummary extends Component {
    constructor (props){
        super(props)
        }
    render() {
        return(
            <div>
                Summary
                <table border="3" text-align='center' width = '800px' >
                    <tr>
                        <th>Total Customer</th>
                        <th>Tip</th>
                    </tr>
                    <tr>
                        <th>no of Customer</th>
                        <th>Tip value</th>
                    </tr>
                </table>
            </div>

        )
    }
}

export default DataSummary
